INSERT INTO `sm_simple_blog_article_description` (`simple_blog_article_description_id`, `simple_blog_article_id`, `language_id`, `article_title`, `description`, `meta_description`, `meta_keyword`, `short_description`) VALUES
(365, 53, 1, 'Group Iontach announcement:', '&lt;p&gt;Welcome to iontach.biz&lt;/p&gt;&lt;p&gt;Dear Members/Guiders,&lt;/p&gt;&lt;p&gt;We are honestly to greets you to our system.&lt;/p&gt;&lt;p&gt;Iontach is not a bank, Iontach does not collect your money, Iontach is not an online business, HYIP, investment or MLM program. Iontach is a community where people help each other. Iontach gives you a technical platform which helps millions of participants worldwide to connect those who NEED help to those who are ready to Iontach help, for FREE.&lt;/p&gt;&lt;p&gt;All transferred funds to another participant are your help given by your own good will to another one, absolutely gratis. If you are completely confident and certain in your actions and make your mind to participate, we kindly ask you to study carefully all warnings and instructions first.&lt;/p&gt;&lt;p&gt;In cases of any matter regarding the topic Our online consultants are ready to help and answer all of your questions.&lt;/p&gt;&lt;p&gt;Best Regards&lt;/p&gt;&lt;p&gt;iontach.biz&lt;/p&gt;', '', '', 'At the request of the Vietnam market! Visit the official system Iontach open ports in Vietnam market! At 19h15 \'dated 19.12.2016 to customers, investors Vietnam!'),
(366, 53, 2, 'Iontach thông báo:', '&lt;p&gt;Chào mừng bạn đến với &amp;nbsp;iontach.biz&lt;/p&gt;&lt;p&gt;Các thành viên thân mến,&lt;/p&gt;&lt;p&gt;Iontach không phải là ngân hàng, không thu tiền của bất kỳ ai. Iontach không phải là cách kiếm tiền siêu lợi nhuận, không phải là kinh doanh đa cấp. Iontach là một cộng đồng nơi mọi người giúp đỡ lẫn nhau. Iontach cung cấp cho bạn một giải pháp công nghệ dựa trên nền tảng website giúp hàng triệu người tham gia để kết nối những người CẦN giúp đỡ với những người đã sẵng sàng giúp đỡ, một cách hoàn toàn tự nguyện.&lt;/p&gt;&lt;p&gt;Không có bất kỳ đảm bảo và hứa hẹn nào về tài chính của bạn trong Iontach, luôn nhớ rằng bạn tham gia bằng số tiền nhàn rỗi. Số tiền bạn chuyển đến trực tiếp cho các thành viên khác trong cộng đồng mang tính chất hoàn toàn tự nguyện, với mong muốn những điều tốt đẹp sẽ &amp;nbsp;đến với họ. Iontach không chịu bất cứ bồi hoàn nào.&lt;/p&gt;&lt;p&gt;Nếu bạn hoàn toàn tự tin và sẵng sàng trở thành một thành viên của cộng đồng Iontach, Xin vui lòng đọc kỹ hướng dẫn, quy định và luật của Iontach trước khi quyết định tham gia.&lt;/p&gt;&lt;p&gt;Iontach.biz&lt;/p&gt;', '', '', 'At the request of the Vietnam market! Visit the official system Iontach open ports in Vietnam market! At 19h15 \'dated 19.12.2016 to customers, investors Vietnam!'),
(367, 56, 1, '[Announcements] - Our FIRST PD WILL BE SET ON MARCH 17, 2017', '&lt;p&gt;Dear Members/Guiders&lt;/p&gt;&lt;p&gt;As proposed by VietNam Leader, We are pleased to announce that our FIRST PD will be set on March 17,2017&lt;/p&gt;&lt;p&gt;Best regards&lt;/p&gt;&lt;p&gt;Iontach.biz&lt;/p&gt;', '', '', 'Dear Members/Guiders\r\n\r\nAs proposed by VietNam Leader, We are pleased to announce that our FIRST PD will be set on March 17,2017\r\n\r\nBest regards\r\n\r\nIontach.biz'),
(368, 56, 2, 'Iontach thông báo: NGÀY KÍCH HOẠT PIN ĐẦU TIÊN 17/03/2017', '&lt;p&gt;Các thành viên thân mến,&lt;/p&gt;&lt;p&gt;Theo đề nghị của Leader Việt Nam, Iontach trân trọng thông báo đến các thành viên ngày kích pin đầu tiên của chúng ta sẽ diễn ra vào ngày 17/03/2017&lt;/p&gt;&lt;p&gt;Trân trọng!&lt;/p&gt;&lt;p&gt;Iontach.biz&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', '', 'Các thành viên thân m?n,\r\n\r\nTheo ?? ngh? c?a Leader Vi?t Nam, Iontach trân tr?ng thông báo ??n các thành viên ngày kích pin ??u tiên c?a chúng ta s? di?n ra vào ngày 17/03/2017\r\n\r\nTrân tr?ng!\r\n\r\nIontach.biz');
