INSERT INTO `tintuc` (`TinTucID`, `TieuDe`, `Image`, `MoTa`, `NoiDung`, `Ngay`, `HienThi`) VALUES
(2, 'Street style yêu không chịu nổi của các nhóc tì tại Tuần lễ thời trang Seoul', '/application/data/uploads/image/32.png', '<h2 class=sapo fl mgt10 mgb10>Xuất hiện với c&aacute;c phong c&aacute;ch thời trang v&ocirc; c&ugrave;ng dễ thương v&agrave; chất lừ, c&aacute;c c&ocirc; nh&oacute;c cậu nh&oacute;c c&ograve;n thể hiện t&agrave;i tạo d&aacute;ng chẳng kh&aacute;c n&agrave;o một fashion icon s&agrave;nh điệu.</h2>\n<h2 class=sapo fl mgt10 mgb10>Xuất hiện với c&aacute;c phong c&aacute;ch thời trang v&ocirc; c&ugrave;ng dễ thương v&agrave; chất lừ, c&aacute;c c&ocirc; nh&oacute;c cậu nh&oacute;c c&ograve;n thể hiện t&agrave;i tạo d&aacute;ng chẳng kh&aacute;c n&agrave;o một fashion icon s&agrave;nh điệu.</h2>', '<div align=center><img src=https://shop.gdgclub.org/application/data/uploads/image/17.png alt= width=700 height=687 /></div>\n<div align=center><br />(Ảnh: Ssoso_s2 Instagram)</div>', '2015-03-27 07:33:32', b'1'),
(3, 'BST hàng hiệu đắt đỏ của con gái 6 tháng tuổi nhà Kim Kardashian', '/application/data/uploads/image/32.png', '<h2 class=sapo fl mgt10 mgb10>D&ugrave; mới chỉ 6 th&aacute;ng tuổi nhưng c&ocirc; b&eacute; North West đ&atilde; sở hữu cả BST h&agrave;ng hiệu đ&igrave;nh đ&aacute;m, với những m&oacute;n từ v&agrave;i chục l&ecirc;n tới hơn 300 triệu đồng.</h2>\n<h2 class=sapo fl mgt10 mgb10>D&ugrave; mới chỉ 6 th&aacute;ng tuổi nhưng c&ocirc; b&eacute; North West đ&atilde; sở hữu cả BST h&agrave;ng hiệu đ&igrave;nh đ&aacute;m, với những m&oacute;n từ v&agrave;i chục l&ecirc;n tới hơn 300 triệu đồng.</h2>', '<p style=text-align: center;>Mới đ&acirc;y, tr&ecirc;n Instagram v&agrave; Twitter, c&ocirc; Kim đ&atilde; đăng tải những bức ảnh về m&oacute;n qu&agrave; m&agrave; bạn b&egrave; d&agrave;nh tặng cho c&ocirc; con g&aacute;i nhỏ k&egrave;m theo lời cảm ơn tới từng người. Mặc d&ugrave; mới chỉ được 6 th&aacute;ng tuổi nhưng b&eacute; North West cũng đ&atilde; sớm được sở hữu tủ đồ thời trang s&aacute;nh ngang với b&agrave; mẹ s&agrave;nh điệu Kim Kardashian của m&igrave;nh.</p>\n<p style=text-align: center;>Nh&acirc;n dịp Gi&aacute;ng sinh, c&ocirc; c&ocirc;ng ch&uacute;a b&eacute; nhỏ của cặp sao Kanye West - Kim Kardashian đ&atilde; nhận được rất nhiều m&oacute;n qu&agrave; Gi&aacute;ng sinh từ c&aacute;c nh&agrave; thiết kế nổi tiếng tr&ecirc;n thế giới như Stella McCartney, Giuseppe Zanotti,Charlotte Olympia v&agrave; Hermes Paris... Đ&acirc;y đều l&agrave; những m&oacute;n qu&agrave; được đặt ri&ecirc;ng cho b&eacute; North. V&igrave; vậy, gi&aacute; th&agrave;nh của ch&uacute;ng ở mức kh&aacute; cao.</p>\n<div style=text-align: center;><img src=https://shop.gdgclub.org/application/data/uploads/image/3.png alt= width=750 height=765 /></div>\n<p style=text-align: center;>Một nguồn tin cho biết, cặp đ&ocirc;i nữ ca sĩ Beyonc&eacute; v&agrave; nam ca sĩ Jay-Z l&agrave; bạn th&acirc;n của Kanye West đ&atilde;d&agrave;nh tặng cho thi&ecirc;n thần của người bạn ch&iacute; cốt những m&oacute;n đồ đẹp nhất. Trong lần thăm hỏi đầu ti&ecirc;n, cặp đ&ocirc;i h&agrave;o ph&oacute;ng đ&atilde; gửi tặng cho Nori một đ&ocirc;i bốt Christian Dior v&agrave; bộ v&ograve;ng cổ, lắc c&ugrave;ng khuy&ecirc;n tai của Elsa Peretti Padova c&oacute; tổng gi&aacute; trị l&ecirc;n tới 5.000 bảng Anh (khoảng 172 triệu đồng). V&agrave;o th&aacute;ng 5, họ c&ograve;n gửi tặng chiếc ghế đ&iacute;nh pha l&ecirc; trị gi&aacute; 9.000 bảng Anh (khoảng 310 triệu đồng) do Carla Monchen thiết kế cho b&eacute; Nori.</p>', '2015-03-27 07:34:37', b'1'),
(4, 'Mặc xinh cho bé với lookbook mới nhất của Zara và H&M', '/application/data/uploads/image/1.png', '<h2 class=sapo fl mgt10 mgb10>Hai thương hiệu thời trang b&igrave;nh d&acirc;n h&agrave;ng đầu mang tới những lựa chọn v&ocirc; c&ugrave;ng dễ thương cho c&aacute;c b&eacute; với từng độ tuổi kh&aacute;c nhau v&agrave;o m&ugrave;a đ&ocirc;ng n&agrave;y.</h2>\n<h2 class=sapo fl mgt10 mgb10>Hai thương hiệu thời trang b&igrave;nh d&acirc;n h&agrave;ng đầu mang tới những lựa chọn v&ocirc; c&ugrave;ng dễ thương cho c&aacute;c b&eacute; với từng độ tuổi kh&aacute;c nhau v&agrave;o m&ugrave;a đ&ocirc;ng n&agrave;y.</h2>', '<p style=text-align: left;>M&ugrave;a Thu/Đ&ocirc;ng đến, b&ecirc;n cạnh những bộ Lookbook đẹp long lanh d&agrave;nh cho người lớn, hẳn c&aacute;c bạn cũng kh&ocirc;ng muốn bỏ qua những bộ ảnh tuyệt đẹp ch&agrave;o h&agrave;ng c&aacute;c sản phẩm mới d&agrave;nh cho c&aacute;c b&eacute; đến từ những thương hiệu lớn? <br /><br />1. Zara <br /><br />M&ugrave;a Thu/Đ&ocirc;ng năm nay, Zara tr&igrave;nh l&agrave;ng hai bộ Lookbook d&agrave;nh cho 2 đối tượng trẻ kh&aacute;c nhau: Mini - Từ 1 đến 9 th&aacute;ng v&agrave; Kids - 2 đến 14 tuổi. <br /><br />Trong bộ Lookbook d&agrave;nh cho c&aacute;c b&eacute; ở độ tuổi Mini, ch&uacute;ng dễ d&agrave;ng phải xi&ecirc;u l&ograve;ng trước những thiết kế đơn giản nhưng cực kỳ dễ thương của Zara. Từ những đ&ocirc;i gi&agrave;y Mary Jane xinh xắn, cho tới những chiếc &aacute;o len ấm &aacute;p hay những bộ đồ liền như được may cho b&uacute;p b&ecirc;. Chất liệu tốt, m&agrave;u sắc ngọt ng&agrave;o v&agrave; thiết kế đ&aacute;ng y&ecirc;u, chắc chắn c&aacute;c b&agrave; mẹ trẻ sẽ rất h&aacute;o hức sắm cho con m&igrave;nh những thiết kế n&agrave;y của Zara Mini.<br /><br /></p>\n<div style=text-align: center; align=center><img src=https://shop.gdgclub.org/application/data/uploads/image/1.png alt= width=750 height=843 /></div>', '2015-03-27 07:37:03', b'1'),
(5, 'Hạnh Chi - Cô nhóc 10 tuổi với phong cách khiến người lớn phải hâm mộ', '/application/data/uploads/image/32.png', '<h2 class=sapo fl mgt10 mgb10>C&ocirc; b&eacute; c&oacute; khu&ocirc;n mặt bầu bĩnh cực xinh xắn n&agrave;y khiến ai cũng phải bật cười với phong c&aacute;ch thời trang đi theo hướng... vintage cổ điển, nhưng vẫn cực k&igrave; nh&iacute; nhỉ v&agrave; đ&aacute;ng y&ecirc;u của m&igrave;nh.</h2>\n<h2 class=sapo fl mgt10 mgb10>C&ocirc; b&eacute; c&oacute; khu&ocirc;n mặt bầu bĩnh cực xinh xắn n&agrave;y khiến ai cũng phải bật cười với phong c&aacute;ch thời trang đi theo hướng... vintage cổ điển, nhưng vẫn cực k&igrave; nh&iacute; nhỉ v&agrave; đ&aacute;ng y&ecirc;u của m&igrave;nh.</h2>', '<div style=text-align: left;>Hẳn ch&uacute;ng ta vẫn chưa qu&ecirc;n Đăng Quang - cậu nh&oacute;c l&uacute;c đ&oacute; mới 4 tuổi những đ&atilde; khiến nhiều người phải xu&yacute;t xoa với phong c&aacute;ch thời trang chất kh&ocirc;ng k&eacute;m người lớn của m&igrave;nh. V&agrave; h&ocirc;m nay, ch&uacute;ng ta sẽ tiếp tục phải h&acirc;m mộ lần 2 với một nh&oacute;c t&igrave; kh&aacute;c: c&ocirc; b&eacute; Hạnh Chi, 10 tuổi với phong c&aacute;ch ri&ecirc;ng rất đ&aacute;ng y&ecirc;u v&agrave; ấn tượng.</div>\n<div style=text-align: center;>&nbsp;</div>\n<div style=text-align: center;>&nbsp;</div>\n<div style=text-align: center;><img src=https://shop.gdgclub.org/application/data/uploads/image/32.png alt= width=700 height=751 /></div>\n<p>&nbsp;</p>\n<div style=text-align: center;>Thực hiện: Nờ Zim</div>\n<div style=text-align: center;>Ảnh: An Vũ</div>', '2015-03-27 07:39:58', b'1'),
(6, 'Cập nhật xu hướng thời trang mùa xuân cực xinh cho bé', '/application/data/uploads/image/17.png', '<h2 class=sapo fl mgt10 mgb10>Bạn sẽ kh&ocirc;ng thể k&igrave;m l&ograve;ng trước những bộ lookbook th&aacute;ng 2 qu&aacute; đỗi xinh xắn v&agrave; đ&aacute;ng y&ecirc;u cho c&aacute;c b&eacute; dưới đ&acirc;y.</h2>', '<div class=relative_new>\n<div style=text-align: left;>C&oacute; một l&yacute; do đơn giản để hiểu được v&igrave; sao Zara lu&ocirc;n l&agrave; h&atilde;ng thời trang được ph&aacute;i đẹp y&ecirc;u th&iacute;ch v&agrave; quan t&acirc;m tới tất cả c&aacute;c bộ sưu tập thời trang của h&atilde;ng như vậy. Kh&ocirc;ng chỉ chiều l&ograve;ng được ph&aacute;i đẹp với những thiết kế kiểu c&aacute;ch lu&ocirc;n thay đổi v&agrave; bắt kịp xu hướng thời trang m&agrave; b&ecirc;n cạnh đ&oacute;, h&atilde;ng thời trang n&agrave;y cũng chưa bao giờ lơ l&agrave; trong những thiết kế d&agrave;nh cho trẻ em. Trong bộ sưu tập mới đ&acirc;y, họa tiết kẻ ngang, chấm bi đi c&ugrave;ng những gam m&agrave;u pastel tươi s&aacute;ng được khai th&aacute;c một c&aacute;ch triệt để tr&ecirc;n khung h&igrave;nh hoa l&aacute; nhiệt đới v&ocirc; c&ugrave;ng ấn tượng v&agrave; hấp dẫn. N&oacute; mang lại h&igrave;nh ảnh tươi s&aacute;ng, nh&iacute; nhảnh của c&aacute;c c&ocirc; b&eacute;, cậu b&eacute; v&ocirc; tư chơi đ&ugrave;a - một h&igrave;nh ảnh khiến bất cứ b&agrave; mẹ n&agrave;o cũng ng&atilde; l&ograve;ng v&agrave; bị chinh phục.&nbsp;</div>\n<div style=text-align: center;>&nbsp;</div>\n<div style=text-align: center;>&nbsp;</div>\n</div>\n<p><img src=https://shop.gdgclub.org/application/data/uploads/image/17.png alt= width=700 height=687 /></p>', '2015-03-27 07:41:04', b'1'),
(7, 'Ngất ngây với BST Dolce & Gabbana Thu 2014 dành cho trẻ em', '/application/data/uploads/image/17.png', '<h2>Những thiết kế d&agrave;nh cho c&aacute;ch b&eacute; trong m&ugrave;a thu đ&ocirc;ng n&agrave;y ch&iacute;nh l&agrave; phi&ecirc;n bản mini của bộ sưu tập Fall 2014 được tr&igrave;nh diễn hồi đầu năm.</h2>\n<h2>Những thiết kế d&agrave;nh cho c&aacute;ch b&eacute; trong m&ugrave;a thu đ&ocirc;ng n&agrave;y ch&iacute;nh l&agrave; phi&ecirc;n bản mini của bộ sưu tập Fall 2014 được tr&igrave;nh diễn hồi đầu năm.</h2>', '<div class=relative_new>Lấy &yacute; tưởng từ khu rừng chứa đựng những c&acirc;u chuyện cổ t&iacute;ch, mẫu &aacute;o kho&aacute;c cape với mũ l&ocirc;ng gợi li&ecirc;n tưởng tới h&igrave;nh ảnh c&ocirc; b&eacute; qu&agrave;ng khăn đỏ, những chiếc vương miện, &aacute;o cho&agrave;ng của b&agrave; ti&ecirc;n, hay họa tiết mu&ocirc;ng th&uacute; như s&oacute;c, thỏ, c&uacute; m&egrave;o, hươu nai... v&ocirc; c&ugrave;ng đ&aacute;ng y&ecirc;u v&agrave; ngộ nghĩnh được in th&ecirc;u đầy sống động tr&ecirc;n c&aacute;c thiết kế d&agrave;nh cho trẻ em như &aacute;o kho&aacute;c, v&aacute;y liền, ch&acirc;n v&aacute;y, gi&agrave;y...\n<div>&nbsp;</div>\n<div>Đ&oacute; l&agrave; những chiếc &aacute;o cho&agrave;ng cape, v&aacute;y liền chất liệu gấm, voan cao cấp được in th&ecirc;u họa tiết mu&ocirc;ng th&uacute;, hoa l&aacute; nổi bật v&agrave; sống động. Từng thiết kế đều theo chủ đề kh&aacute;c nhau, được lấy &yacute; tưởng từ khu rừng cổ t&iacute;ch hay những chiếc ch&igrave;a kh&oacute;a dẫn v&agrave;o l&acirc;u đ&agrave;i...<br />\n<div>&nbsp;</div>\n<div>\n<div>&nbsp;C&ugrave;ng chi&ecirc;m ngưỡng những bộ sưu tập tuyệt đẹp d&agrave;nh cho trẻ em trong m&ugrave;a thu 2014:</div>\n</div>\n<div>&nbsp;</div>\n<img src=https://shop.gdgclub.org/application/data/uploads/image/1.png alt=width=750 height=843 /></div>\n</div>', '2015-03-27 07:44:51', b'1'),
(8, 'Hạnh Chi - Cô nhóc 10 tuổi với phong cách khiến người lớn phải hâm mộ', '/application/data/uploads/image/3.png', '<p>Hạnh Chi - C&ocirc; nh&oacute;c 10 tuổi với phong c&aacute;ch khiến người lớn phải h&acirc;m mộ</p>', '<p>Hạnh Chi - C&ocirc; nh&oacute;c 10 tuổi với phong c&aacute;ch khiến người lớn phải h&acirc;m mộ</p>\n<p><img src=https://shop.gdgclub.org/application/data/uploads/image/1.png alt=width=750 height=843 /></p>\n<p><img src=https://shop.gdgclub.org/application/data/uploads/image/32.png alt=width=700 height=751 /></p>', '2017-02-21 17:12:44', b'1');
